// src/App.js
import React, { useState } from 'react';
import { Routes, Route, Link, BrowserRouter } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Signup from './pages/Signup';
import About from './pages/About';
import Mypage from './pages/Mypage'; // Mypage 컴포넌트 추가
import PrivateRoute from './component/PrivateRoute'; // PrivateRoute 컴포넌트 추가
import { AuthProvider, useAuth } from './component/auth'; // AuthProvider와 useAuth 훅 불러오기

function App() {
  return (
    <AuthProvider>
      <BrowserRouter> {/* Router는 한 번만 사용 */}
        <Navigation />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/Signup" element={<Signup />} />
          <Route path="/About" element={<About />} />
          <Route
            path="/Mypage"
            element={
              <PrivateRoute> {/* PrivateRoute는 Router 안에서만 사용 */}
                <Mypage />
              </PrivateRoute>
            }
          />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

function Navigation() {
  const { token, logout } = useAuth(); // 인증 상태와 로그아웃 함수 가져오기

  return (
    <div>
      <nav>
        <Link to="/"><button>홈</button></Link>
        <Link to="/Signup"><button>회원가입</button></Link>
        <Link to="/Login"><button>로그인</button></Link>
        <Link to="/About"><button>소개</button></Link>
        {token && <Link to="/Mypage"><button>마이페이지</button></Link>}
        {token && <button onClick={logout}>로그아웃</button>}
      </nav>
    </div>
  );
}

export default App;
